I had to either remove `transformed_image` from **output** due to shards problems:
``` JSON

{
    "transformed_image":{
        "node_name":"image_transformation_node",
        "data_item":"transformed_image_out"
     }
}

```


`image_transformation.cpp` was reporting problems with shards that don't have the same description because the layout of the current shard is ANY and the first shard CHW, it's weird because in this node we do transform (in the case we maintain) the layout to CHW based on parameters and with only one object it works... I found the Layout == ANY in [tensorinfo.cpp](https://github.com/openvinotoolkit/model_server/blob/main/src/tensorinfo.cpp#L34)

I did take a look into the [gathernodeinputhandler.cpp](https://github.com/openvinotoolkit/model_server/blob/main/src/gathernodeinputhandler.cpp#L52) and saw that there is a comparison between two Tensordescriptions that came from and IE Module.

